import { ICard, IRequestData } from '../utils/interfaces';

export interface IReducerState {
  cards: {
    TO_DO: ICard[];
    DOING: ICard[];
    DONE: ICard[];
  };
  get: IRequestData<ICard>
  put: IRequestData<ICard>
  post: IRequestData<ICard>
  delete: IRequestData<ICard>
}

const initialState: IReducerState = {
  cards: {
    TO_DO: [
      { id: '1', titulo: 'TO_DO' }
    ],
    DOING: [
      { id: '2', titulo: 'DOING' }
    ],
    DONE: [
      { id: '3', titulo: 'DONE' }
    ]
  },
  get: {},
  put: {},
  post: {},
  delete: {}
};

const appReducer = (): IReducerState => initialState;

export default appReducer;
